    River Estuary, WA on July 20 & 21, 2009. The original requested survey area (26,150
    acres) was expanded, at the client?s request, to include more of the valley lowland
    areas in the SW and SE edge of the original AOI as well as additional creeks on
    the northern edge of the survey (Figure 1). The total area of delivered LiDAR and
    True-color Orthophotographs, including the expansion and 100 m buffer, is 32,140
